
import React, { useState, useRef, useEffect } from 'react';
import { Button } from "@/components/ui/button";
import { Card } from "@/components/ui/card";
import { Play, Pause, Volume2, BarChart3 } from "lucide-react";

interface ToneProfile {
  stability: number;
  similarity: number;
  pitch: number;
  rate: number;
  style: string;
  description: string;
}

interface VoicePlayerProps {
  script: string;
  tone?: 'neutral' | 'urgent_calm' | 'ritual_authority' | 'nurturing_gentle';
  voiceId?: string;
  className?: string;
}

const TONE_SETTINGS: Record<string, ToneProfile> = {
  urgent_calm: { 
    stability: 0.2, 
    similarity: 0.7, 
    pitch: 15, 
    rate: 0.8,
    style: 'firm yet calming',
    description: 'For crisis intervention - authoritative but soothing'
  },
  ritual_authority: { 
    stability: 0.05, 
    similarity: 0.9, 
    pitch: -10, 
    rate: 0.7,
    style: 'deep ritual cadence',
    description: 'For protection rituals - mystical and commanding'
  },
  nurturing_gentle: { 
    stability: 0.35, 
    similarity: 0.8, 
    pitch: 5, 
    rate: 0.65,
    style: 'warm and motherly',
    description: 'For aftercare - soft and comforting'
  },
  neutral: {
    stability: 0.25,
    similarity: 0.75,
    pitch: 0,
    rate: 1.0,
    style: 'balanced',
    description: 'Standard conversational tone'
  }
};

const ToneBars: React.FC<{ tone: string; isPlaying: boolean }> = ({ tone, isPlaying }) => {
  const profiles = {
    urgent_calm: [80, 60, 95, 70, 85],
    ritual_authority: [40, 90, 30, 95, 50],
    nurturing_gentle: [60, 50, 70, 55, 65],
    neutral: [70, 70, 70, 70, 70]
  };
  
  const bars = profiles[tone as keyof typeof profiles] || profiles.neutral;
  
  return (
    <div className="flex items-end gap-1 h-8">
      {bars.map((height, i) => (
        <div 
          key={i} 
          className={`w-2 rounded-t transition-all duration-300 ${
            isPlaying ? 'bg-purple-400 animate-pulse' : 'bg-gray-600'
          }`}
          style={{ 
            height: `${height}%`,
            animationDelay: `${i * 100}ms`
          }}
        />
      ))}
    </div>
  );
};

export const VoicePlayer: React.FC<VoicePlayerProps> = ({ 
  script, 
  tone = 'neutral', 
  voiceId = 'EXAVITQu4vr4xnSDxMaL',
  className = '' 
}) => {
  const [isPlaying, setIsPlaying] = useState(false);
  const [isLoading, setIsLoading] = useState(false);
  const [error, setError] = useState<string | null>(null);
  const [audioUrl, setAudioUrl] = useState<string | null>(null);
  const audioRef = useRef<HTMLAudioElement>(null);

  const toneProfile = TONE_SETTINGS[tone];

  const generateSSML = (text: string, profile: ToneProfile): string => {
    return `
      <speak>
        <prosody pitch="${profile.pitch >= 0 ? '+' : ''}${profile.pitch}%" rate="${profile.rate}">
          <emphasis level="moderate">
            ${text}
          </emphasis>
        </prosody>
      </speak>
    `;
  };

  const synthesizeVoice = async () => {
    if (!script?.trim()) return;
    
    setIsLoading(true);
    setError(null);

    try {
      // This would normally call ElevenLabs API
      // For demo purposes, we'll simulate the API call
      console.log('Synthesizing voice with profile:', {
        tone,
        profile: toneProfile,
        ssml: generateSSML(script, toneProfile)
      });

      // Simulate API delay
      await new Promise(resolve => setTimeout(resolve, 1500));
      
      // In production, this would be the actual audio URL from ElevenLabs
      // For now, we'll use a placeholder that demonstrates the concept
      const mockAudioUrl = 'data:audio/wav;base64,' ;
        
        setAudioUrl(mockAudioUrl);
        
    } catch (error) {
        console.error('Voice synthesis error:', error);
        setError('Unable to generate voice at this time. Please try again.');
    } finally {
        setIsLoading(false);
    }
};

const playAudio = () => {
    if (audioRef.current && audioUrl) {
        if (isPlaying) {
            audioRef.current.pause();
            setIsPlaying(false);
        } else {
            // For the demo, we'll just simulate playback
            setIsPlaying(true);
            // Simulate audio duration
            setTimeout(() => {
                setIsPlaying(false);
            }, 3000);
        }
    } else if (!audioUrl) {
        synthesizeVoice();
    }
};

return (
    <Card className={`bg-gray-800/50 border-gray-700 ${className}`}>
        <div className="p-4">
            <div className="flex items-center justify-between mb-3">
                <div className="flex items-center gap-2">
                    <Volume2 className="w-4 h-4 text-purple-400" />
                    <span className="text-sm font-medium text-white">
                        {toneProfile.style} tone
                    </span>
                    <span className="text-xs text-gray-400">
                        ({tone})
                    </span>
                </div>
                <ToneBars tone={tone} isPlaying={isPlaying} />
            </div>
            
            <div className="text-xs text-gray-300 mb-3">
                {toneProfile.description}
            </div>
            
            <div className="flex items-center gap-3">
                <Button
                    onClick={playAudio}
                    disabled={isLoading}
                    size="sm"
                    className="bg-purple-600 hover:bg-purple-700"
                >
                    {isLoading ? (
                        <div className="animate-spin w-4 h-4 border-2 border-white border-t-transparent rounded-full" />
                    ) : isPlaying ? (
                        <Pause className="w-4 h-4" />
                    ) : (
                        <Play className="w-4 h-4" />
                    )}
                    <span className="ml-1 text-xs">
                        {isLoading ? 'Generating...' : isPlaying ? 'Playing' : 'Play Voice'}
                    </span>
                </Button>
                
                <div className="flex items-center gap-1 text-xs text-gray-400">
                    <BarChart3 className="w-3 h-3" />
                    <span>Pitch: {toneProfile.pitch >= 0 ? '+' : ''}{toneProfile.pitch}%</span>
                    <span>•</span>
                    <span>Rate: {Math.round(toneProfile.rate * 100)}%</span>
                </div>
            </div>
            
            {error && (
                <div className="mt-2 text-xs text-red-400 bg-red-900/20 p-2 rounded">
                    {error}
                </div>
            )}
            
            <audio ref={audioRef} className="hidden" />
        </div>
    </Card>
);
};
